use heroku_dd756aadddfcc21;

CREATE TABLE `heroku_dd756aadddfcc21`.`transactions` (
  `id` BIGINT(15) NOT NULL,
  `date` DATETIME NOT NULL,
  `device` VARCHAR(2) NOT NULL,
  `search_medium` VARCHAR(150) NOT NULL,
  `shipping` FLOAT NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE INDEX `id_UNIQUE` (`id` ASC)
);


CREATE TABLE `heroku_dd756aadddfcc21`.`products` (
  `id` BIGINT(15) NOT NULL AUTO_INCREMENT
  `sku` BIGINT(15) NOT NULL,
  `id_transaction` BIGINT(15) NOT NULL,
  `name` VARCHAR(300) NOT NULL,
  `price` FLOAT NOT NULL,
  `sale_price` FLOAT NOT NULL,
  `quantity` INT NOT NULL,
  `category` VARCHAR(300) NOT NULL,
  `unit_revenue` FLOAT NOT NULL,
  PRIMARY KEY (`id`),
  INDEX `idTransactions_idx` (`id_transaction` ASC),
  CONSTRAINT `idTransactions`
    FOREIGN KEY (`id_transaction`)
    REFERENCES `heroku_dd756aadddfcc21`.`transactions` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION
);




